description:
Phoenix is going over the design of her foyer with Johnny, who is her interior decorator. He personally put it together and thinks it's the best room in the house. Phoenix hates it and runs his design into the ground. Johnny is willing to do whatever it takes to fix the foyer to what she likes. Phoenix wants Johnny to kiss her ass but not in the sucking up to the teacher type of kiss ass. She explains to him that she wants him to drop down to his knees and lick her asshole! Looks like Johnny will be seeing Phoenix's interior in more ways than one.

